snippet.textDisplay:
@Nilma Silva não amiga, é falado pelo seus próprios seguidores que o deus de Israel é onicinte,  onipotente e onipresent, dito isso vocês tem a certeza de que seu deus está em todos os lugares todo o tempo, inclusive dentro de um chiqueiro evangélico. 

Você tá criticando os evangélicos? Se esqueceu da Santa inquisição? De padres pedófilos e estrupadores? De pessoas mentirosas que se denominavam santos? De mulheres serem queimadas vivas?
É o sujo falando do mal lavado.

